import React from 'react'

import { Container } from './styles'

const UserList: React.FC = () => {
    return (
        <Container>
            <Role>Online - 1</Role>
            <UserRow nickname="insanity" />

            <Role>Offline - 1</Role>
            <UserRow nickname="UserPH" />
        </Container>
    )
}

export default UserList
